function input (){
    const [text,setText] = useState('')


    function onch(event) {
       
        setText("t")
    }



    return(
        <div>
            <br></br>
            <from>
                <input onChange={onch} type="text"></input>
                <button> ok </button>
            </from>

            <ul>
                <li>{text}</li>
            </ul>
        </div>
        
        
    )

}


export default input;
